 "shadowOpacity": 0.19,
 "shadow": true,
 "paddingBottom": 10,
 "backgroundOpacity": 0.91,
 "class": "HTMLText",
 "shadowSpread": 1,
 "borderRadius": 10,
 "shadowVerticalLength": 2,
 "visible": false,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:30px;font-family:'Calibri';\"><B>Kelenteng Hwie Wie Kiong</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:12px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Calibri';\">Klenteng ini berusia ratusan tahun dan memiliki arsitektur yang unik. Hampir seluruh bagian bangunannya penuh dengan ukiran asli Cina, bahkan bahan bangunan, termasuk kayunya didatangkan langsung dari Daratan Tiongkok menggunakan kapal. Karakter Tiongkok Selatan langsung terlihat dari bentuk bubungan atap Klenteng Hwie Wie Kiong yang menyerupai ekor walet. Patung Shi Zi atau singa jantan dan betina sebagai simbol keharmonisan selalu menyambut setiap pengunjung klenteng. Bertempat di Jalan Sebandaran, Kawasan Pecinan, Kota Semarang, Klenteng Hwie Wie Kiong diperkirakan berdiri sejak abad ke-18. Usia klenteng ini memang terbilang sangat tua, namun banyak bagian dan arsitektur bangunan yang masih asli, seperti ukiran-ukiran yang menghiasi setiap sudut bagian klenteng ini.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Calibri';\">Secara garis besar, tata ruang klenteng ini dibagi jadi tiga: ruang suci utama, balai leluhur, dan ruang paling belakang yang belum diketahui fengshuinya. Tidak ada bangunan samping seperti lazimnya klenteng-klenteng besar.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Calibri';\">Klenteng Hwie Wie Kiong memiliki tiga pintu masuk ke dalam ruang suci utama, namun pintu masuk yang sering dilalui oleh pengunjung adalah pintu masuk yang paling kanan. Hal tersebut rupanya memiliki maknanya. Pintu paling kanan disebut Pintu Naga Hijau (Qinglong), sementara pintu kiri klenteng disebut Pintu Macan Putih (Baihu). Masuk melalui pintu kanan merupakan lambang kemakmuran, sementara keluar dari mulut macan melambangkan lolos dari bahaya. Akses pintu-pintu ini menandakan setiap orang yang masuk dan keluar klenteng diberi kemakmuran dan lolos dari bahaya. Sementara itu, pintu tengah klenteng kerap dibiarkan. Pintu ini biasanya dibuka saat perayaan Cap Go Meh. Dan patung dewa utama klenteng akan dibawa keluar melalui pintu ini. Lukisan malaikat menghiasi dua daun pintu: Qie-Lan Pu-Sa dan Wei-tuo-Pu-Sa. Keduanya adalah Bodhisattva pelindung agama Buddha. Kedua lukisan ini sebagai simbol pelindung klenteng dari roh jahat. Pada setiap pintu, terdapat ambang balok yang disebut di fu ban yang dapat dilepas. </SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Calibri';\">Melangkah ke dalam, semerbak asap menyeruak dari batang dupa yang tertancap di depan altar, aroma khas memenuhi setiap sudut ruang klenteng. Sebagai sumber pencahayaan alami dan sirkulasi udara, terdapat tiga ruang terbuka di klenteng ini. Dua ruang terbuka kembar berada di belakang serambi, dan satu ruang terbuka lainnya terletak di balai belakang. Keberadaan tiga ruang terbuka tersebut menghasilkan sirkulasi udara yang baik di dalam ruang, tidak sesak oleh asap dupa karena udara senantiasa bergerak mengalir. Sinar mentari juga bebas masuk tanpa menimbulkan panas. Orang akan merasa nyaman dan sejuk ketika berada di dalam. Ketika siang hari, bagian dalam klenteng jadi terang benderang.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:18px;font-family:'Calibri';\">Setiap ukiran yang menghiasi Klenteng Hwie Wie Kiong tidak hanya sebagai pemanis saja, namun juga mengandung doa dan filosofi tersendiri, seperti ukiran naga yang dipercaya dalam Mitologi Tiongkok sebagai makhluk pembawa berkah dan memberi perlindungan. \u201cKlenteng Hwie Wie Kiong ini yang paling bagus ukiran-ukirannya di Kota Semarang,\u201dujar Hadi Winarto, mantan pengurus Klenteng Hwie Wie Kiong. Klenteng Hwie Wie Kiong masih menjaga keaslian bentuk bangunannya sampai saat ini. Klenteng pribadi ini awalnya dibangun untuk pemujaan terhadap leluhur Marga Tan, namun sekarang dibuka untuk umum, baik untuk beribadah maupun untuk sekedar melihat-lihat. Bagi Anda yang ingin menyaksikan kemegahan warisan budaya dan sejarah Cina di Indonesia, Klenteng Hwie Wie Kong dapat menjadi pilihan wisata edukatif, tanpa dipungut biaya.</SPAN></SPAN></DIV></div>",
