 "shadowSpread": 1,
 "borderRadius": 10,
 "shadowVerticalLength": 2,
 "visible": false,
 "html": "<div style=\"text-align:left; color:#000; \"><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"color:#333333;font-size:30px;font-family:'Calibri';\"><B>Kelenteng Ling Hok Bio</B></SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:15px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:18px;font-family:'Calibri';\">Kelenteng Ling Hok Bio awalnya dibangun oleh komunitas Tionghoa di Semarang sebagai tempat untuk memuja Dewa Ling Hok, yang diyakini membawa keberuntungan dan kesejahteraan. Nama \"Ling Hok Bio\" sendiri memiliki arti \"Kelenteng Dewa Keberuntungan\". Bangunan kelenteng ini mencerminkan gaya arsitektur tradisional Tionghoa, dengan atap melengkung, ornamen naga, dan ukiran-ukiran yang indah. Struktur bangunannya kokoh, dengan penggunaan kayu dan batu sebagai material utama. Di dalam kelenteng terdapat altar-altar yang didedikasikan untuk berbagai dewa dan dewi, serta patung-patung yang dihias dengan cermat. Selain sebagai tempat ibadah, Kelenteng Ling Hok Bio juga berfungsi sebagai pusat kegiatan sosial dan budaya bagi komunitas Tionghoa di Semarang. Berbagai festival dan acara keagamaan, seperti Cap Go Meh dan Tahun Baru Imlek, dirayakan dengan meriah di sini. Kelenteng ini juga sering menjadi tempat berkumpulnya masyarakat untuk mengadakan kegiatan sosial, seperti bakti sosial dan penggalangan dana.</SPAN></SPAN></DIV><p STYLE=\"margin:0; line-height:18px;\"><BR STYLE=\"letter-spacing:0px;color:#000000;font-size:12px;font-family:Arial, Helvetica, sans-serif;\"/></p><DIV STYLE=\"text-align:justify;\"><SPAN STYLE=\"letter-spacing:0px;color:#000000;font-family:Arial, Helvetica, sans-serif;\"><SPAN STYLE=\"font-size:18px;font-family:'Calibri';\">Selama bertahun-tahun, Kelenteng Ling Hok Bio telah mengalami berbagai upaya pemeliharaan dan restorasi untuk menjaga keaslian dan keindahannya. Pemerintah setempat bersama dengan komunitas Tionghoa aktif terlibat dalam menjaga kelenteng ini agar tetap menjadi warisan budaya yang berharga. Kelenteng Ling Hok Bio tidak hanya penting bagi umat Tridharma, tetapi juga menjadi simbol keragaman budaya dan toleransi beragama di Semarang. Keberadaan kelenteng ini menunjukkan bagaimana komunitas Tionghoa telah menjadi bagian integral dari sejarah dan perkembangan kota Semarang. Dengan latar belakang sejarah yang panjang dan makna budaya yang dalam, Kelenteng Ling Hok Bio tetap menjadi salah satu situs bersejarah yang penting di Semarang dan terus menarik perhatian baik umat beragama maupun wisatawan.</SPAN></SPAN></DIV></div>",
